/* eslint-disable no-unused-vars */
import React, { useEffect, useState } from 'react';
import Axios from 'axios'
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'
import MyNotes from './notes/MyNotes'
import Notes from './notes/Notes'
import AddNote from './notes/AddNote'
import { useHistory } from 'react-router';
import Navbar from './Navbar';

const Dashboard = () => {

    const routes = [
        {

        }
    ]

    const [user, setUser] = useState("");
    const [isLoggedIn, setIsLoggedIn] = useState(false)

    const url = "http://localhost:3002/auth";
    const token = localStorage.getItem("token");
    let history = useHistory();

    const getUser = () => {
        Axios.get((url), {
            headers: {
                "token": `${token}`
            }
        }).then((response) => {
            // console.log("response", response)
            setUser(response)
        })
    }

    useEffect(() => {
        getUser();
    }, [])

    // const addNote = () => {
    //     history.push("/add-note")
    // }
    // const allNotes = () => {
    //     history.push("/notes")
    // }

    return (
        <Router>
            <div className="container-page">
                <header className="header">
                    <Navbar getUser={getUser} />
                </header>
                <div className="dashboard">
                    {/* <button onClick={addNote}>Add note</button> */}
                    <Switch>
                        <Route path="/add-note" exact component={AddNote} />
                        <Route path="/my-notes" exact component={MyNotes} />
                        <Route path="/notes" exact component={Notes} />
                        <MyNotes />
                        <AddNote />
                        <Notes />
                    </Switch>
                    {/* <button onClick={allNotes}>all notes</button> */}
                </div>
            </div>
        </Router>
    )
}

export default Dashboard
